INSERT INTO `cp_howtoplay` VALUES (1,50,'<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n<meta charset=\"UTF-8\">\n<title>pk10玩法</title>\n\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\">\n\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, user-scalable=no\">\n\n<style>\n section { padding: 4.4rem 0; } pre { white-space: pre-wrap; font-family: -webkit-body; }\n</style>\n\n</head>\n\n<body>\n\n<div style=\"line-height: 2rem; font-size: 14px;\">\n  <pre>北京pk10玩法 \n •   该游戏的投注时间、开奖时间和开奖号码与“北京PK拾”完全同步，北京时间（ GMT+8）每天白天从上午09:10 开到晚上 23:50，每20分钟开一次奖, 每天开奖 44期。    \n•   具体游戏规则如下:  \n  •   1～10 双面玩法：指单、双；大、小。  \n  •    单、双：号码为双数叫双，如4、8 ；号码为单数叫单，如 5、9。   \n •    大、小：开出之号码大于或等于6为大，小于或等于5 为小。  \n •   第一名～第十名车号指定： 每一个车号为一投注组合，开奖结果“投注车号”对应所投名次视为中奖，其余情形视为不中奖。     \n     1～5龙虎 【注意规则】 为:  \n  •   冠　军龙/虎：“第一名”车号大于“第十名”车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。 \n   •   亚　军龙/虎：“第二名”车号大于“第九名”车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。 \n   •   第三名龙/虎：“第三名”车号大于“第八名”车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。  \n  •   第四名龙/虎：“第四名”车号大于“第七名”车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。  \n  •   第五名龙/虎：“第五名”车号大于“第六名”车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。    \n•   “冠军车号＋亚军车号＝冠亚和值”\n    •   冠亚和单双 ：“冠亚和值”为单视为投注“单”的注单视为中奖，为双视为投注“双”的注单视为中奖，其余视为不中奖。    \n•   冠亚和大小：“冠亚和值”大于11时投注“大”的注单视为中奖，小于或等于11时投注“小”的注单视为中奖，其余视为不中奖。  \n  •   冠亚和指定：“冠亚和值”可能出现的结果为3～19， 投中对应“冠亚和值”数字的视为中奖，其余视为不中奖。      \n  •   冠亚组合： 冠亚军号码均落在组合之内.如投注1-2,冠军为1号,亚军为2号或者冠军为2号,亚军为1号则中奖。          </pre>\n   </div>\n\n</body>\n\n</html>');

